recommend(Restaurant, Cuisine, Price, City) :-
    restaurant(Restaurant, Cuisine, Price, City, _, _, _, _).

recommend(Restaurant, Cuisine, Price, City, Ambience) :-
    restaurant(Restaurant, Cuisine, Price, City, Ambience, _, _, _).

recommend(Restaurant, Cuisine, Price, City, Ambience, Type, MinRating) :-
    restaurant(Restaurant, Cuisine, Price, City, Ambience, Type, Rating, _),
    Rating >= MinRating.

explain :-
    write('This system recommends restaurants based on:'),
    nl,
    write('- Cuisine (e.g., south_indian, chinese)'),
    nl,
    write('- Budget (low, medium, high)'),
    nl,
    write('- City (e.g., Chennai, Coimbatore)'),
    nl,
    write('- Ambience (casual, fine_dining, etc.)'),
    nl,
    write('- Type (veg, nonveg, veg_nonveg)'),
    nl,
    write('- Minimum Rating (e.g., 4.0)'),
    nl.

start :-
    explain,
    write('Enter preferred cuisine: '), read(Cuisine),
    write('Enter budget (low/medium/high): '), read(Price),
    write('Enter city: '), read(City),
    write('Enter ambience: '), read(Ambience),
    write('Enter type (veg/nonveg/veg_nonveg): '), read(Type),
    write('Enter minimum rating (e.g., 4.0): '), read(MinRating),
    recommend_full(Restaurant, Cuisine, Price, City, Ambience, Type, MinRating),
    format('Recommended: ~w~n', [Restaurant]),
    fail.

start :-
    write('No more recommendations.').
